-- Create temporary table
CREATE TEMP TABLE temp_ratings_import (
  unique_id TEXT,
  tm_name TEXT,
  leader_name TEXT,
  timestamp TIMESTAMPTZ,
  position TEXT,
  rating_1 INTEGER,
  rating_2 INTEGER,
  rating_3 INTEGER,
  rating_4 INTEGER,
  rating_5 INTEGER,
  location_id UUID
);

